#Change some unnecessary title
def changeTitle(d):
    if(d['Title'] == 'Dr.'):
        return 'Dr'
    if(d['Sex'] == 1):
        if (d['Title'] in ['Mr.', 'Don.', 'Rev.', 'Major.', 'Sir.', 'Col.', 'Capt.', 'Jonkheer.']):
            return 'Mr'
        elif(d['Title'] in ['Master.']):
            return 'Master'
    if(d['Sex'] == 0):
        if (d['Title'] in ['Lady.', 'Ms.', 'Mrs.']):
            return 'Mrs'
        else:
            return 'Miss'
